  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains biological resource
  data for alcids, shorebirds, waterfowl, diving birds, pelagic birds, gulls and terns
  in the Aleutian Islands, Alaska. Points in this data set represent locations of
  bird nesting sites. Species-specific abundance, seasonality, status, life history,
  and source information are stored in relational data tables (described below) designed
  to be used in conjunction with this spatial data layer.This data set comprises a
  portion of the Environmental Sensitivity Index (ESI) data for Aleutians East Borough
  and Aleutians West Coastal Resource Service Area (CRSA). These data identify the
  marine and coastal environments and wildlife. The ESI data include information for
  three main components: shoreline habitats, sensitive biological resources, and human-use
  resources. See also the BIRDS (Bird Polygons) data layer, part of the larger Aleutians
  East/Aleutians West ESI database, for additional bird information.\",\n\t\"owner_org\":
